شنو زيت الكركار ؟ هو زيت عشبي متكون من ١٢ نوع من  الزيوت  تعالج الشعر 

❤️الحل الأفضل والنهائي لجميع مشاكل الشعر❤️ 

❣️يعمل على إيقاف تساقط الشعر
❣️يحفز على نمو وتطويل الشعر والقضاء على التقصف  وتكسر الشعر 
❣️يعطي نعومه ولمعان وتسريح الشعر من اول استخدام 
❣️يعالج تساقط الشعر الناتج من الأصباغ والكرياتين 
❣️يملي الفراغات الي بالشعر 
 
